import {FloatingLabel, Form} from 'react-bootstrap'

import React, { Component } from 'react'

class FloatingLabelsEmail  extends Component {

    

    render() {
        return (

            <>

            <FloatingLabel
                controlId="floatingInput"
                label="Email address"
                className="mb-3"
            >
    
                <Form.Control 
                    type="email" 
                    name="email"
                    placeholder="name@example.com" 
                    onChange={()=> props.handleChange()}
                />
    
            </FloatingLabel>
    
            </>

        )
    }
}

export default FloatingLabelsEmail
